css:
.fb-on-demand-instances-container {
  display: flex;
  flex-flow: column;
}
.fb-on-demand-instances-container-header {
  border-bottom: 1px solid #181a1f;
  padding-bottom: 10px;
  position: absolute;
}
.fb-on-demand-instances-container-header h1 {
  font-size: 1.6em;
  font-weight: bold;
  color: #d7dae0;
  display: inline-block;
}
.fb-on-demand-instances-container-header button {
  float: right;
}
.fb-on-demand-instance-container {
  flex: 1;
  display: flex;
  flex-flow: column nowrap;
}
.fb-on-demand-instance-type-header {
  flex: 2;
  line-height: 1.5em;
}
.fb-on-demand-instance {
  flex: 1;
  display: flex;
  flex-flow: row nowrap;
  background-color: #31363f;
  color: #9da5b4;
  padding: 10px;
  white-space: normal;
  border-bottom: 1px solid #181a1f;
  clear: both;
  overflow: hidden;
}
.fb-on-demand-instance:first-of-type {
  border-top: 1px solid #181a1f;
}
.fb-on-demand-instance-host {
  padding: 3px;
  overflow: hidden;
  text-overflow: ellipsis;
  flex: 1 1 100%;
}
.fb-on-demand-instance-host span {
  white-space: nowrap;
}
.fb-on-demand-instance-host .instance-hostname {
  font-weight: bold;
}
.fb-on-demand-instance-buttons {
  flex: 1;
}
.fb-on-demand-instance-release-modal {
  clear: both;
  overflow: hidden;
}
.fb-on-demand-instance-release-modal p {
  background-color: #31363f;
  color: #9da5b4;
  padding: 10px;
  white-space: normal;
}
.fb-on-demand-instance-release-modal-buttons {
  float: right;
}
